import React from "react";
import { useLocation, useNavigate } from "react-router-dom";

const PredictionResult = () => {
  const location = useLocation();
  const navigate = useNavigate();

  const { result, filename } = location.state || {};

  if (!result || !filename) {
    return (
      <div className="flex justify-center items-center h-screen text-center">
        <p className="text-lg text-gray-600">
          No prediction data available. Please upload an image first.
        </p>
      </div>
    );
  }

  const imageUrl = `http://127.0.0.1:5000/uploads/${filename}`;

  return (
    <div className="flex flex-col justify-center items-center h-screen bg-gray-100 px-4">
      <div className="bg-white shadow-md rounded-lg p-6 w-full max-w-md text-center">
        <h2 className="text-2xl font-bold text-gray-800 mb-4">Prediction Result</h2>
        <p className="text-lg text-gray-600 mb-4">
          <strong className="font-semibold">Result:</strong> {result}
        </p>
        <h3 className="text-xl font-medium text-gray-700 mb-2">Uploaded Image:</h3>
        <img
          src={imageUrl}
          alt="Uploaded MRI"
          className="max-w-full h-auto rounded-lg mb-6 border border-gray-200"
        />
        <button
          onClick={() => navigate("/")}
          className="bg-blue-500 text-white px-4 py-2 rounded-md hover:bg-blue-600 focus:ring-2 focus:ring-blue-400 focus:outline-none transition-all duration-200"
        >
          Go Back
        </button>
      </div>
    </div>
  );
};

export default PredictionResult;
